    [],nt"num_tags": 3,nt"name": "chincoteague-refuge-narrative-report-may-1-to-august-31-1947",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Chincoteague
    NWR outlines Refuge accomplishments from May through August of 1947. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, big game animals, furbearers, predators, rodents,
    mammals, and raptors- is also covered. The Refuge development and maintenance section
    discusses physical developments. Resource management is outlined; topics include
    grazing. The public relations section of the report describes recreational uses,
    Refuge visitors, and violations. N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
